import { Card } from 'antd';

const { Meta } = Card;

function CardSaya(props) {
    return (
        <div className="wrapper">
            <Card
                hoverable
                style={{ width: 240 }}
                cover={<img alt="example" src="https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png" />}
            >
                <p><b></b></p>
                <p>{props.nim}</p>
            </Card>
        </div>
    )
}

export default class Cards extends Component {
    render() {
        return (
            <div className="wrapper">
                <div>
                    <CardSaya nama="Muhammad Fadhli Hisyam" nim="21120117130078" />
                </div>
                <div>
                    <CardSaya nama="Naufal Muhammad Shafa" nim="21120117120031" />
                </div>
            </div>

        );
    }
}
